/**
 * @typedef {string} MessageAudience
 * @enum {MessageAudience}
 * @private
 */
const MessageAudience = {
    // Indicates that all participants can see this message
    ALL: "ALL",
    // Indicates that the message is a "private message" that can only be seen by brand users
    AGENTS_AND_MANAGERS: "AGENTS_AND_MANAGERS",
    // Used internally when creating Messages from lastContentEventNotification
    UNKNOWN: "UNKNOWN"
};

module.exports = MessageAudience;
